-- ----------------------------
-- Function structure for generate_roll_code
-- ----------------------------
DROP FUNCTION IF EXISTS "master"."generate_roll_code"("material_id" int4);
CREATE OR REPLACE FUNCTION "master"."generate_roll_code"("material_id" int4)
  RETURNS "pg_catalog"."varchar" AS $BODY$
DECLARE
    current_date CHAR(6);
    material_info VARCHAR(50);
    sequence_number INT;
    roll_code VARCHAR(50);
BEGIN
    -- Generate current date in YYMMDD format
    SELECT to_char(CURRENT_DATE, 'YYMMDD') INTO current_date;
    
    -- Fetch material information
    SELECT code INTO material_info
    FROM master.m_material
    WHERE id = material_id;

    -- Get the next sequence number from the sequence
    sequence_number := nextval('roll_code_seq');

    -- Generate the roll code
    roll_code := current_date || material_info || '-' || sequence_number;

    -- Return the generated roll code
    RETURN roll_code;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

